function initImageUrlManager(E){window.addEventListener("load",()=>{initTable({FIELDS_FETCH:["id","image_name","image_url","sequence"],FIELDS_TABLE:[{CONTENT_TYPE:CONTENT_TYPES.TEXT,CONTENT_FIELD:"id"},{CONTENT_TYPE:CONTENT_TYPES.TEXT,CONTENT_FIELD:"image_name",CONTENT_FIELD_STICKY:"true"},{CONTENT_TYPE:CONTENT_TYPES.LINK,CONTENT_FIELD:"item.image_url",CONTENT_FIELD_EXTRA_HASH:'"content-modal"',CONTENT_FIELD_EXTRA_END:'data-bs-toggle="modal"',CONTENT_FIELD_EXTRA_ONCLICK:'"setModalContent(`" + encodeURIComponent(item.image_name) + "`,`" + encodeURIComponent(item.image_url) + "`)"'},{CONTENT_TYPE:CONTENT_TYPES.TEXT,CONTENT_FIELD:"sequence"},],FIELDS_TABLE_HEADER:["",E.MSG_NAME,E.MSG_URL,E.MSG_SEQUENCE],FIELDS_TABLE_ORDERBYS:["",E.ORDER_NAME,E.ORDER_URL,E.ORDER_SEQUENCE],RADIO_SHOW_BUTTON_IDS:["btn-modify","btn-delete"],noMove:!1})})}function setModalContent(E,e){document.querySelector("#content-modal-header").innerHTML=decodeURIComponent(E),document.querySelector("#content-modal-body").src=decodeURIComponent(e)}